/**
 * 根据字符创获取数据
 * @param str
 */
function parseOriginDataWithString(str){
    return parseOriginData(JSON.parse(str));
}

/**
 * 根据json对象获取数据
 * @param data
 */
function parseOriginData(data) {
    let obj = new Object();
    obj.waveId = data.wave_id;
    let content = data.wave_property.split("^");
    obj.waveName = content[1]; //
     let dp_unit= content[2].split("&");
     obj.dp = Number(dp_unit[0]);
    obj.unit = dp_unit[1];
    let jiaozhun_jizhunzhi = content[3].split("&");
    obj.jiaozhun = Number(jiaozhun_jizhunzhi[0]);
    obj.jizhunzhi = Number(jiaozhun_jizhunzhi[1]);
    obj.frameSize = Number(content[4]);
    let min_max = content[5].split("&");
    obj.min = Number(min_max[0]);
    obj.max = Number(min_max[1]);
    obj.length = Number(content[6]);
    // console.log('parseOriginData',JSON.stringify(obj));
    obj.data = parseOriginWaveData(obj.frameSize,obj.length,data.wave_data);

    return obj;
}

function parseOriginWaveData(frameSize,step,data) {
    let array = [];
    for (let y = 0; y < frameSize*2*step; y += 2*step) {
        // 将值装换成负数，然后加上上限，这样就可以将数据倒转，不会导致波峰波谷颠倒
        // array.push(-(parseInt(data.substr(y, 2), 16) / this.scale));
        array.push(parseInt("0x"+data.substr(y, 2*step), 16))
        // array.push(parseInt(data.substr(y, 2), 16))
    }

    return array;
}
